INSERT INTO `productos` VALUES (1,'QT RACER SPORT',8999.00,'Estas zapatillas adidas te acompañan con comodidad durante todo el día, cuando corrés en la mañana, en tus actividades de la tarde y en tus reuniones nocturnas. La mediasuela Lightmotion ofrece amortiguación liviana que notarás mientras pasan las horas. Este producto está hecho con Primeblue, un material reciclado de alto rendimiento creado en parte con Parley Ocean Plastic.',1,1,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(2,'ZX 1K BOOST',13999.00,'Cuando estás cargado y activado, nada puede interponerse en tu camino. Al menos, nada DEBERÍA interponerse en tu camino. La comodidad es clave y estas zapatillas adidas ZX 1K Boost la ofrecen por montones gracias a su mediasuela que es mitad Boost y mitad EVA (también conocida como la combinación ganadora). Salí a las calles. Divertíte. Estas zapatillas están listas para todo el recorrido.',1,1,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(3,'ZX 2K FLORINE',13999.00,'Las zapatillas adidas ZX 2K Florine fueron creadas especialmente para mujeres. Mujeres de vanguardia y amantes de la moda. Aquellas que conocen la tecnología y tienen mentalidad digital. Las que aprecian el estilo vintage pero se inspiran en lo moderno.',1,1,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(4,'SUPERSTAR W  ',15999.00,'Las zapatillas Adidas Superstar no necesitan mucha presentación. Su historia hizo que dejen de ser un calzado para ser un ícono de la moda. Nacidas en los 70\'s para el básquet, fueron recorriendo el mundo urbano de la mano del skateboarding y principalmente el hip-hop. Estilo de sobra con el detalle de las tres tiras (three-stripes) típicas de la marca y su característica puntera de caucho.',1,2,1,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(5,'ADIDAS SLEEK SUPER ',13999.00,'¿A quién no le gusta el satén? Es suave, elegante y está presente en estas zapatillas adidas Sleek Super. Amarrá los cordones con punta de metal y sentí que formás parte de una comunidad única y alegre. La suela con plataforma agrega unos centímetros a tu altura.',1,2,2,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(6,'SL ANDRIDGE',13999.00,'Lo sencillo puede ser hermoso cuando se hacen las cosas bien. Estas zapatillas adidas SL Andridge presentan un diseño con nylon satinado, cuero de charol y gamuza, además de una mediasuela brillante con acabado perlado. Traen una suela con plataforma que te proporciona un toque extra de altura y un estilo a la moda.',1,2,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(7,'NIKE JOYRIDE DUAL RUN FLYKNIT',34999.00,'Ganale al asfalto no importa la distancia, las Zapatillas Nike Joyride Run Flyknit son similares a un bean bag para tu pie, por lo que no se parece en absoluto a nada que hayas visto. Su construcción en tejido Fly knit las hace frescas y transpirables, las microesferas del talón se reacomodan entre cada pisada para mayor suavidad y amortiguación; su suela de goma y con ranuras mejoran la flexibilidad desde el talón hasta la punta del pie, dándote mejores resultados en velocidad y comodidad al correr.',1,3,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(8,'NIKE REACT INFINITY RUN',31999.00,'Diseñamos las Nike React Infinity Run para ayudar a reducir lesiones y seguir corriendo. En uno de nuestros estudios independientes más grandes, estas zapatillas ayudaron a los participantes a correr mientras entrenaban para una media maratón.',1,3,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(9,'NIKE AIR MAZ EXCEE',31999.00,'Para corredoras que valoran cada minuto y la velocidad es primordial, las nuevas Zapatillas Nike Air Max Excee son perfectas porque combinan una estética minimalista clásica, el estilo urbano de la marca junto con su tecnología Air max que te brinda mejores y amortiguadas pisadas que te darán estabilidad y confianza a la hora de correr en cualquier lugar donde vayas.',1,3,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(10,'PUMA LQDCELL METHOD UNLIMITED FLORAL',11999.00,'La tecnología LQDCELL de PUMA te proporcionará una base sólida en tu próxima sesión de entrenamiento. Las funciones de alta tecnología de las zapatillas de entrenamiento LQDCELL Method Unlimited Floral para mujer te acompañarán en todos tus entrenamientos de agilidad, para que te sientas fresca y veloz a la vez.',1,4,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(11,'PUMA CRUISE RIDER',13799.00,'Inspiradas en la belleza de las famosas Silk Road, estas zapatillas incluyen combinaciones de colores que crean un look muy original. La entresuela IMEVA te brinda liviandad y comodidad para que tus pies sean felices.',1,4,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(12,'MAGNIFY NITRO DE RUNNING',20899.00,'¿Qué ofrecen estas zapatillas de running? Una amortiguación y una comodidad máximas en cada carrera. Además, gracias a la entresuela con NITRO FOAM, experimentarás una capacidad de respuesta y una amortiguación superiores que, además, es muy ligera. La suela exterior incorpora el compuesto de goma PUMAGRIP, que proporciona tracción en todo tipo de superficies. Son unas zapatillas creadas para durar, confeccionadas para rendir y diseñadas pensando en el estilo.',1,4,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(13,'GEL-NIMBUS 22',25990.00,'Experimente la máxima comodidad con el modelo GEL-NIMBUS ™ 22 . Combinado con tecnologías para mejorar el rendimiento de los corredores neutrales, ofrece una combinación de máxima amortiguación y rendimiento, con tecnología de amortiguación GEL ™ ubicada en el talón con excelente absorción de impactos. La doble capa de tecnología FLYTEFOAM ™ y FLYTEFOAM ™ Propel en la entresuela proporciona más ligereza, comodidad y capacidad de respuesta. La tecnología TRUSSTIC ™ debajo del arco de tenis proporciona estabilidad, reduce el peso y ayuda a prolongar la vida útil del zapato. La parte superior liviana permite que sus pies sean transpirables, ofreciendo un ajuste de apoyo y adaptable. Diseñado con corredores de alto kilometraje, el GEL-NIMBUS ™ 22 implementa un nuevo diseño de entresuela para reducir la severidad del impacto. Además, la suela AHAR + reduce el nivel de desgaste de la goma, lo que le permite concentrarse en pasar más tiempo entrenando. Ya sea que sea un profesional experimentado o un principiante, el GEL-NIMBUS ™ 22 ha sido diseñado para ofrecer la máxima amortiguación, comodidad y más capacidad de respuesta.',1,5,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(14,'GEL-KAYANO 27',25990.00,'Disfruta de una comodidad excelente y un soporte avanzado con el modelo GEL-KAYANO® 27. La parte superior completamente rediseñada ayuda a mantener los pies frescos, mientras que la suela más flexible ayuda a promover un ciclo de zancada más natural durante las carreras. Esto se debe a que el talón tiene ranuras adicionales que dan como resultado una mayor flexibilidad y al mismo tiempo ofrecen absorción de impactos durante los pasos. Para ayudar a este movimiento natural, incorporamos la tecnología DYNAMIC DUOMAX® para aumentar la estabilidad de los corredores que utilizan el interior del pie (sobrepronación). La entresuela también integra la tecnología SPACE TRUSSTIC ™, que proporciona más estabilidad y reduce el peso total de las zapatillas, promoviendo una transición más suave. Finalmente, los detalles reflectantes en el talón ayudan a mantener los pasillos visibles con poca luz. El modelo GEL-KAYANO® 27 es una excelente opción para todos los corredores que buscan un zapato que combine comodidad con sujeción y protección.',1,5,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(15,'GEL-NAGOYA 2',13990.00,'Las zapatillas ASICS GEL-Nagoya 2 brindan comodidad, durabilidad y versatilidad durante la semana. Su parte superior de malla permite una mayor transpirabilidad a los pies. La entresuela tiene la capa de EVA y la tecnología GEL icon en el talón maximizando la comodidad. Su interior también tuvo muchas mejoras añadiendo mayor acolchado y una plantilla más cómoda.',1,5,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(16,'CONVERSE G4',21999.00,'Una ciudad emite energía eléctrica. Es diverso. Un crisol de cultura, arte, ideas, comida, vida nocturna, arquitectura. Pero, ¿qué lo hace latir? ¿El ruido? ¿Las luces? ¿El horizonte? ¿Ese ajetreo de timbre batidor? No ... somos nosotros. Somos el corazón de esta ciudad. Inspirado en los tribunales, la cultura callejera y la vida nocturna de París.Lleva tu corazón en tus pies con zapatillas inspiradas en ciudades icónicas',1,6,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(17,'ALL STAR PRO BB EVO',22999.00,'El Converse All Star BB EVO es un fenómeno de media caña que aporta una amortiguación adicional en el talón para mayor protección. Una parte superior textil de malla mixta maximiza la contención y la transpirabilidad, y la entresuela Nike React amortigua y se impulsa durante el uso. El deslumbramiento deslumbrante de la celebración de mitad de temporada cobra vida a través de una parte superior en espiga con detalles iridiscentes.',1,6,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(18,'RUN STAR HIKE',16999.00,'Una plataforma voluminosa y una suela de goma dentada dan un giro inesperado a tus Chucks de todos los días. Detalles como un diseño de lona y una puntera de goma la mantienen fiel a las originales. Cuenta además con una plataforma moldeada, una suela exterior de dos tonos y un talón redondeado para un look futurista.',1,6,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(19,' FILA FLOAT JOGGER',10490.00,'Las Zapatillas Fila Float Jogger están confeccionadas en ante y textil fusionando un estilo casual y deportivo para brindarte un diseño auténtico. Además, tienen plantilla de EVA para proporcionarte toda la comodidad y seguridad que vos necesitas. Poseen un cierre mediante cordones. Y suela tratada en TPU engomado para ofrecerte mayor durabilidad y agarre al suelo. Su entresuela suave tiene tecnología Float, inspirada en compuestos orgánicos, que te permitirá mayor amortiguación y retorno de energía. Mantienen la esencia de las zapatillas de running de los años 90 y de las Euro Jogger obteniendo como resultado este calzado pensado para tu rutina diaria',1,7,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(20,'FILA DISRUPTOR II',12999.00,'Variante nueva de Disruptor desarrollada en una capellada simulando un tejido, con una cadena decorativa que recorre la parte media y trasera del pie. Suela de caucho con entresuela de EVA.Su aspecto robusto está inspirado en la moda de los años 90.',1,7,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(21,'FILA TREND 2.0',7490.00,'El modelo Trend posee un sistema de ajuste Slip-On y su capellada está confeccionada con un tejido con tecnología Engineered-Mesh, también elástico en el lateral del pie y un contrafuerte reforzado de doble espuma. Entresuela monobloc con Energized Rubber de anatomía diferenciada. Plantilla de confort Super-Foam.',1,7,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(22,'NEW BALANCE 413',8199.00,'Estate siempre lista para correr con nuestras New Balance 413. Estas zapatillas de running están fabricadas con tecnología optimizada para ofrecer una sensación de ligereza y un rendimiento cómodo. La parte superior está hecha de tejido sintético para una sensación suave e incluye soporte para un ajuste seguro. La almohadilla incorporada en el antepié proporciona soporte adicional para que puedas extender cada paso.',1,9,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(23,'FRESH FOAM 1080 V11',25199.00,'Nuestra Fresh Foam 1080v11 proporciona un confort de lujo en largas distancias. Esta suave zapatilla de running combina tenología Fresh Foam en la entresuela con una suave capellada de tejido elástico que ofrece una comodidad de 360 ​​grados para altos kilometrajes. Incluye la tecnología Ultra Heel que rodea el talón para un ajuste ceñido con excelente sujeción que envuelve el pie en puro confort.',1,9,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(24,'NEW BALANCE 574',11449.00,'Clásicas, expresivas e inspiradoras. Creadas en 1988 combinando 2 calzados NB diferentes (nos gusta llamarlo el mashup original), las zapatillas de mujer New Balance 574 se han convertido en un símbolo de ingenio y originalidad',1,9,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(25,'LADY TIE BREAK III',6499.00,'Zapatilla Topper Tie Break III Off Court.Un calzado ideal para el uso diario, confort y seguridad en cada pisada.Capellada en cuero sintetico y costuras para mayor mayor confort y durabilidad. mantiene el pie fresco y seco en el uso intensivo.Suela inyectada de pu, un material exclusivo de topper que otorga gran amortiguacion y confort.',1,8,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(26,'SQUAT',7699.00,'Las zapatillas Topper Squat están confeccionadas en mesh para un calce más natural y anatómico, además de brindarte una mayor respirabilidad. La entresuela de EVA termoformada absorbe tus impactos y reduce la presión en cada paso. La suela de goma aumenta la resistencia al desgaste y mejora la durabilidad.',1,8,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(27,'FAST',6699.00,'Diseño y detalles únicos en un calzado de performance para quienes practican deporte y aman la moda.Suela con t-cushion para reducir la presión y mejorar la absorción del impacto. Diseño específico de la base de suela para un óptimo agarre. Diseñada para corredores con pisada neutra.',1,8,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(28,'ZAPATILLAS GALAXAR RUN',10999.00,'Cuando empezás a correr por primera vez, no se trata de ganar maratones. Se trata de sentirse bien para que los kilómetros se conviertan en algo que deseás con ansias. Las zapatillas adidas Galaxar Run fueron creadas pensando en los nuevos corredores. El exterior de malla sin costuras es cómodo para correr distancias largas y la mediasuela Bounce agrega amortiguación a tus pies. Este producto está hecho con Primegreen, una serie de materiales reciclados de alto desempeño..',2,1,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(29,'ZAPATILLAS TERREX EASTRAIL',12999.00,'Cuando empezás a correr por primera vez, no se trata de ganar maratones. Se trata de sentirse bien para que los kilómetros se conviertan en algo que deseás con ansias. Las zapatillas adidas Galaxar Run fueron creadas pensando en los nuevos corredores. El exterior de malla sin costuras es cómodo para correr distancias largas y la mediasuela Bounce agrega amortiguación a tus pies. Este producto está hecho con Primegreen, una serie de materiales reciclados de alto desempeño..',2,1,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(30,'ZAPATILLAS KAPTIR SUPER',13999.00,'Un look tradicional de adidas recibe un toque de estilo urbano en estas zapatillas inspiradas en el running. Disfruá la energía sin límites en cada paso gracias a la mediasuela Boost de adidas. Desde tus salidas a correr, hasta una reunión casual en la noche, estarás listo para cualquier plan.',2,1,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(31,'ZAPATILLAS BUSENITZ VULC II',13999.00,'Las zapatillas Busenitz Vulc II son una versión vulcanizada más estilizada de este icónico modelo de skate que retienen detalles claves del diseño original. La plantilla Adiprene moldeada y el cuello GEOFIT antideslizante les permite ofrecer el mismo ajuste del original con la flexibilidad y control de una suela vulcanizada. El exterior de gamuza y el refuerzo Adituff en la punta se encargan de brindar la resistencia al desgaste y la respuesta que esperás encontrar en unas zapatillas Busenitz.',2,2,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(32,'ZAPATILLAS MARATHON TECH',17999.00,'Un estilo retro mitad futuristas. Estas zapatillas Marathon Tech combinan detalles clásicos de adidas Originals como las 3 Tiras y un exterior de cuero con un diseño de talón modernizado que te devuelve la energía que invertís a cada paso.',2,2,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(33,'ZAPATILLAS MULTIX',10999.00,'Lo informal no tiene que ser aburrido. Actualizá tu estilo con estas llamativas zapatillas adidas Multix. El exterior deportivo de malla mantiene tus pies cómodos sin importar lo que te depare el día',2,2,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(34,'ZAPATILLAS NIKE PEGASUS',15599.00,'El modelo NIKE Air Max Excee, está inspirado en Nike Air Max 90, es una celebración de un clásico bajo una nueva óptica.Las líneas alargadas y las proporciones distorsionadas en la parte superior le dan un espacio nuevo y moderno al clásico look de los años 90 que tanto te gusta.La unidad Air es visible a través de 3 ventanas para darte un look actualizado.La entresuela de espuma y la suela brindan comodidad sin agregar peso.Las líneas de diseño alargadas rinden homenaje a las Air Max 90 a la vez que lo modernizan de una forma provocativa.Debido a la naturaleza de exclusiva calidad de la piel y el ante, podría ocurrir que en algunos casos el producto destiñera levemente, sobre todo en condiciones de humedad.Mientras esté mojada, se aconseja que la zapatilla no entre en contacto con otras prendas claras hasta que no esté completamente seca.',2,3,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(35,'ZAPATILLAS NIKE REVOLUTION 5',16550.00,'Buscás zapatillas que te den rapidez, ligereza y amortiguación? Las Zapatillas Nike Free Revolution 5 son las indicadas, correrás los kilómetros que quieras con firmeza y estabilidad cuidando tus pies.',2,3,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(36,'ZAPATILLAS MAX EXCEE',15556.00,'El modelo NIKE Air Max Excee, está inspirado en Nike Air Max 90, es una celebración de un clásico bajo una nueva óptica.Las líneas alargadas y las proporciones distorsionadas en la parte superior le dan un espacio nuevo y moderno al clásico look de los años 90 que tanto te gusta.La unidad Air es visible a través de 3 ventanas para darte un look actualizado.La entresuela de espuma y la suela brindan comodidad sin agregar peso.Las líneas de diseño alargadas rinden homenaje a las Air Max 90 a la vez que lo modernizan de una forma provocativa.Debido a la naturaleza de exclusiva calidad de la piel y el ante, podría ocurrir que en algunos casos el producto destiñera levemente, sobre todo en condiciones de humedad.Mientras esté mojada, se aconseja que la zapatilla no entre en contacto con otras prendas claras hasta que no esté completamente seca.',2,3,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(37,'ZAPATILLAS COMET ALT 2',7399.00,'Preparate para despegar con la sensación ultra acolchada de las Comet 2 Alt Beta.La espuma SOFTRIDE en el talón proporciona una amortiguación óptima.El sistema de cordones dinámico crea un ajuste ceñido y seguro para que estés cubierto sin importar a dónde te lleve el día.Diseñada para corredores con pisada neutra.',2,4,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(38,'ZAPATILLAS SMASH V2',6999.00,'Las zapatillas Puma Smash V2 L ADP incorporan una amortiguación suave para combinar con cualquier outfit y brindarte un ajuste cómodo durante todo el día. Su diseño moderno y el estilo propio de la marca hacen de ella un calzado que debes tener entre tus preferidos. Combinalas con lo que quieras, ese no es su problema, sino su ventaja.',2,4,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(39,'ZAPATILLAS PUMA R78',9199.00,'Redefiní tu look con el toque único de las PUMA R78, su diseño clásico se actualiza con detalles que no pasan desapercibidos.La plantilla Softfoam, proporciona mayor amortiguación, durabilidad óptima y facilita la zancada.Debido a la naturaleza de exclusiva calidad de los materiales, podría ocurrir que en algunos casos el producto destiñera levemente, sobre todo en condiciones de humedad.Mientras esté mojada, se aconseja que la zapatilla no entre en contacto con otras prendas claras hasta que no esté completamente seca.',2,4,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(40,'ZAPATILLAS ASICS GEL',14999.00,'Está confeccionada con material textil y forro acolchado que asegura la comodidad de la circulación del aire a tus pies durante el entrenamiento.El acolchado de gel proporciona una excelente absorción de impactos y la suela de goma proporciona una mayor durabilidad y adherencia al suelo.GEL™, nuestra tecnología icónica utilizada por ASICS desde 1986 protege tu cuerpo del impacto generado en cada paso, ayudando a reducir la fatiga muscular.La tecnología GEL™ se localiza principalmente en las zonas de mayor carga en el momento del impacto, en la zona del talón y en la articulación de la puntera. Diseñada para corredores con pisada neutra.',2,5,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(41,'ZAPATILLAS ASICS PATRIOT',8999.00,'Estas zapatillas están confeccionadas con un empeine de malla transpirable que favorece una mejor circulación de aire y ayuda a que los pies se mantengan frescos durante el ejercicio.Todo ello se complementa con tecnología EVA en la entresuela para crear una respuesta de tipo resorte, proporcionando a estas zapatillas una excelente absorción de los impactos.Por último, la integración de una suela de goma moldeada y el refuerzo interno del talón proporcionan una sujeción adicional para que los pies se mantengan alineados en carreras de larga distancia.Diseñada para corredores con pisada neutra..',2,5,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(42,'ZAPATILLAS ASICS TAKAI',8999.00,'Obtené una gran comodidad y ligereza al caminar con las zapatillas ASICS Taikai.Es un calzado para acompañarte en varios momentos, desde caminatas ligeras, gimnasio y día a día.Su parte superior textil permite una mejor transpiración de los pies, mientras que la suela de goma estriada estratégica ofrece el agarre necesario en el suelo y también una mayor durabilidad. Diseñada para corredores con pisada neutra.',2,5,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(43,'ZAPATILLAS TOPPER CAPITAN',8999.00,'Conocé las Zapatillas Topper Capitan Tt, ideales para lograr un look urbano, cool y atemporal. Se trata de un clásico de la marca, pero totalmente renovado pensado para los nostálgicos. Confeccionadas en microfibra de alta calidad, tienen suela de goma moldeada con propiedades antideslizantes para hacer que tu día a día sea más fácil. Infaltables en tu guardarropa, te ayudan a completar todos los looks.',2,8,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(44,'ZAPATILLAS TOPPER COSTA',7399.00,'Renovamos nuestra familia de productos Tenis Retro con este calzado bien urbano y canchero.Debido a la naturaleza de exclusiva calidad de los materiales, podría ocurrir que en algunos casos el producto destiñera levemente, sobre todo en condiciones de humedad.Mientras esté mojada, se aconseja que la zapatilla no entre en contacto con otras prendas claras hasta que no esté completamente seca',2,8,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(45,'ZAPATILLAS TOPPER NOVA',5799.00,'Un auténtico clásico siempre vuelve. En el caso del modelo Nova Low de Topper, vuelve aún más hermoso y versátil. La capellada de algodón tiene el refuerzo de la lengüeta y el cuello acolchado para garantizar la comodidad del calce. La goma estable y adherente en toda la extensión de la suela brinda seguridad para caminar.',2,8,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(46,'ZAPATILLAS CONVERSE NET STAR',8999.00,'Inspirada en los archivos de CONVERSE, las Net Star están pensadas para que destaques del resto con un estilo clásico que no pasa de moda.Debido a la naturaleza de exclusiva calidad de los materiales, podría ocurrir que en algunos casos el producto destiñera levemente, sobre todo en condiciones de humedad.Mientras esté mojada, se aconseja que la zapatilla no entre en contacto con otras prendas claras hasta que no esté completamente seca',2,6,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(47,'ZAPATILLAS CONVERSE ALL STAR',10995.00,'Un clásico que se revaloriza con el tiempo, estas converse para unisex están diseñadas en piel, y en color Negro con el logo en Blanco  para que sean sencillas y combinables con todo.Perfectas para el día a dia, urbanas, deportivas y estéticamente muy interesantes. Son de piel e incorporan plantilla de Confort por lo que su resistencia es mayor que otros modelos de la marca.',2,6,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(48,'ZAPATILLAS CONVERSE CHUCK',9066.00,'Las Converse All Star Chuck ’70 en lona vintage se han rediseñado con detalles modernos que rinden homenaje al estilo original de las Chuck Taylor All Star de los 70. Cuentan con un ribete de goma algo más alto, una plantilla con amortiguación para una comodidad duradera y una puntera de goma más grande. También presentan otros detalles vintage como una costura en el lateral y una parte superior de lona vintage gruesa para una mayor comodidad y durabilidad.Además, incluyen detalles de las icónicas Chuck Taylor como el parche del tobillo con la estrella en el centro y la suela exterior de goma vulcanizada.',2,6,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(49,'ZAPATILLAS FILA JOGGER',10499.00,'Posee una entresuela con tecología FLOAT que garantiza una excelente amortiguación y retorno de energía.Suela de TPU engomado.Capellada confeccionada en cuero y materiales sintéticos de alta calidad.Debido a la naturaleza de exclusiva calidad de los materiales, podría ocurrir que en algunos casos el producto destiñera levemente, sobre todo en condiciones de humedad.Mientras esté mojada, se aconseja que la zapatilla no entre en contacto con otras prendas claras hasta que no esté completamente seca.',2,7,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(50,'ZAPATILLAS FILA QUARK',6935.00,'FILA presenta las zapatillas de deporte Quark, una innovación para quienes buscan comodidad y estilo durante la práctica, la carrera y las actividades cotidianas. El calzado tiene cuero hecho de tela con partes sintéticas y tiene una lengüeta integrada que, a su vez, lleva el ajuste por medio de cordones. En el interior, un acolchado textil fortalece la región del talón y una plantilla de EVA viene con acción antimicrobiana y se puede quitar, lo que facilita la higiene. Además, la suela y la entresuela están fabricadas con EVA y cuentan con la tecnología Energized Rubber, un innovador sistema de amortiguación. ',2,7,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(51,'ZAPATILLAS FILA TREKKING',9055.00,'Las zapatillas FILA Zermat son un calzado de diseño moderno para actividades al aire libre.Su capellada está confeccionada en Mesh y materiales sinteticos de alta frecuencia.Su suela de caucho de diseño tractorado mejoran la tracción en cualquier tipo de terreno.Diseñado para corredores de pisada neutra ',2,7,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(52,'ZAPATILLAS NEW BALANCE 574',16939.00,'Las zapatillas de hombre 574 cuentan con un diseño minimalista con detalles geométricos y un empeine ligero de ante y malla. Una entresuela con amortiguación Fresh Foam te proporcionará un soporte muy suave para que puedas moverte con facilidad entre los planes del día a día y las actividades de fin de semana.Debido a la naturaleza de exclusiva calidad de la piel y el ante, podría ocurrir que en algunos casos el producto destiñera levemente, sobre todo en condiciones de humedad. Mientras esté mojada, se aconseja que la zapatilla no entre en contacto con otras prendas claras hasta que no esté completamente seca.',2,9,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(53,'ZAPATILLAS NEW BALANCE SO2',12999.00,'Las zapatillas NEW BALANCE 574 estan hechas en una combinación atemporal de mesh y cuero descarne, disponible en colores clásicos y sútiles.No importa donde vayas, estas zapatillas urbanas cuentan con tecnología ENCAP con una amortiguación suave de EVA en la entresuela que te brinda el soporte que necesitas.Debido a la naturaleza de exclusiva calidad de la piel y el ante, podría ocurrir que en algunos casos el producto destiñera levemente, sobre todo en condiciones de humedad.Mientras esté mojada, se aconseja que la zapatilla no entre en contacto con otras prendas claras hasta que no esté completamente seca.',2,9,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(54,'ZAPATILLAS NEW BALANCE XAA',12999.00,'Creadas en 1988 de la combinación de dos zapatillas de NEW BALANCE, las zapatillas de hombre 574 se han convertido en una de nuestros modelos más emblemáticos.La tecnología ENCAP® de la entresuela proporciona soporte y máxima durabilidad. Debido a la naturaleza de exclusiva calidad de la piel y el ante, podría ocurrir que en algunos casos el producto destiñera levemente, sobre todo en condiciones de humedad.Mientras esté mojada, se aconseja que la zapatilla no entre en contacto con otras prendas claras hasta que no esté completamente seca.',2,9,2,1,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(55,'BOTINES PUMA ULTRA',7799.00,'Mejora tu juego con la velocidad adicional que te aportan estos botines de fútbol insuperables.Diseñados pensando en la velocidad, esta edición de los ULTRA está equipada con una serie de detalles funcionales imprescindibles como un empeine liviano y duradero, y una suela exterior SpeedUnit de TPU ultrarrápida e inspirada en los clavos de running, para proporcionarte la mejor mezcla de agilidad y estabilidad.Suela diseñada para canchas de césped natura',2,4,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(56,'ZAPATILLAS PUMA',8999.00,'Un par que va con todo y lleva la inspiración tenística en su diseño, son las zapatillas PUMA Jada para mujeres que ofrece un diseño adecuado para usar diariamente, además de mezclar detalles elegantes en color bronce que las hace únicas.',1,4,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(57,'ZAPATILLAS ADIDAS',20999.00,'La cultura del skate reconoció su durabilidad y comodidad. Las calles apreciaron su estilo retroactivo y versátil. Debido a la naturaleza de exclusiva calidad de la piel y el ante, podría ocurrir que en algunos casos el producto destiñera levemente, sobre todo en condiciones de humedad. Mientras esté mojada, se aconseja que la zapatilla no entre en contacto con otras prendas claras hasta que no esté completamente seca.',2,1,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(58,'ZAPATILLAS ADIDAS',26999.00,'Zapatillas de alto rendimiento para correrAjuste ceñido y cómodo, tipo mediaExterior de tejido adidas Primeknit+Ajuste y sujeción gracias a la tecnología Tailored Fibre Placement',1,1,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(59,'ZAPATILLA NIKE ',12499.00,'Para todos tus díasCamina suave y cómodamente con las Nike Court Vision Low para hombres. Estupendos para cualquier día de la semana y combinarlos con lo que sea. Una vez puestos, serán tus preferidos.',2,3,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(60,'ZAPATILLA NIKE',11999.00,'Las Nike Downshifter 11 ofrecen una sujeción ligera y flexible para que nada te detenga.Incorporan la misma amortiguación suave de la última versión, y añaden más soporte alrededor del mediopié para ofrecer comodidad después del entrenamiento.',1,3,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(61,'ZAPATILLAS ASICS',14990.00,'Hechas de material de malla de alta calidad, estas zapatillas tienen todo lo que esperás en tecnología y rendimiento.Tiene un acolchado de gel que garantiza una excelente estabilidad y suavidad incluso en los terrenos más difíciles.',2,5,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(62,'ZAPATILLA ASICS',14990.00,'Obtené una gran comodidad y ligereza al caminar con las zapatillas ASICS.Es un calzado para acompañarte en varios momentos, desde caminatas ligeras, gimnasio y día a día.',1,5,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(63,'ZAPATILLA TOPPER',5499.00,'Zapatillas topper urbanas •casuales •suela goma antideslizante •capellada cuero sintetico',2,8,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(64,'ZAPATILLAS TOPPER',5499.00,'Llega el Magnus en su segunda versión, un calzado hecho para los amantes de los deportes indoor.-Capellada: Liviana, de mesh con cuero sintético de alta resistencia que proporciona un buen ajuste del pie.-Suela: La amortiguación de la entresuela garantiza la absorción de impactos y protege las articulaciones.',2,8,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(65,'ZAPATILLA CONVERSE ',8695.00,'Ligera y respirable, los jugadores serios no aceptaron ningún otro calzado. En los años posteriores, los fanáticos vieron algo más en la silueta atlética y el inconfundible logotipo de Star Chevron ',2,6,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(66,'ZAPATILLAS CONVERSE',7699.00,'El peso del calzado puede variar según el número solicitado. Los talles corresponden a numeración de Argentina.',1,6,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(67,'ZAPATILLA FILA',7490.00,'El peso del calzado puede variar según el número solicitado. Los talles corresponden a numeración de Argentina.',2,7,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(68,'ZAPATILLA FILA',7590.00,'Calzado moderno de moda con suela robusta de EVA con capellada en materiales sinteticos de alta calidad y detalles en los pasacordones.',1,7,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13'),(69,'ZAPATILLAS NEW BALANCE',10049.00,'Las zapatillas de mujer New Balance  estan hechas en una combinación atemporal de mesh y cuero descarne, disponible en colores clásicos y sútiles.No importa donde vayas, estas  zapatillas urbanas cuentan con tecnología ENCAP con una amortiguación suave de EVA en la entresuela que te brinda el soporte que necesitas',2,9,1,2,'2021-12-04 07:20:13','2021-12-04 07:20:13');
